<h4>ERROR 9: </h4>
<p class="t1Text151"><b>          
&lt;Target&gt; is not a Target in the Build Control File.</b></p>
<p class="t1Text151">Description:</p>
<p class="MsoBodyTextIndent">This error message will occur when a target name is 
passed to om on the command line that does not exist in the generated Build 
Control File.</p>
